import styled from "styled-components"

const Container = styled.div``;


const Product = () => {
  return (
    <Container>
        <Announcement/>
        <Navbar/>
        <Slider/>
        <Categories/>
        <Products/>
        <Newsletter/>
        <Footer/>
    </Container>
  )
}

export default Product
